INSERT INTO quiz_answer SET 0='1', id='1', 1='6', question_id='6', 2='<p><img border=\"0\" align=\"absmiddle\" width=\"250\" vspace=\"0\" hspace=\"0\" height=\"63\" alt=\"HPAnswer1_1.png\" src=\"http://192.168.0.1/virtualclass/courses/KELASVI/document/images/diagrams/templates/HPAnswer1_1.png\" /></p>', answer='<p><img border=\"0\" align=\"absmiddle\" width=\"250\" vspace=\"0\" hspace=\"0\" height=\"63\" alt=\"HPAnswer1_1.png\" src=\"http://192.168.0.1/virtualclass/courses/KELASVI/document/images/diagrams/templates/HPAnswer1_1.png\" /></p>', 3='0', correct='0', 4='<p><img border=\"0\" align=\"absmiddle\" width=\"376\" vspace=\"0\" hspace=\"0\" height=\"300\" alt=\"HPfeedback_1.png\" src=\"http://192.168.0.1/virtualclass/courses/KELASVI/document/images/diagrams/templates/HPfeedback_1.png\" />The working fluid, in its gaseous state, is pressurized and circulated through the system by a compressor. On the discharge side of the compressor, the now hot and highly pressurized vapor is cooled in a heat exchanger, called a condenser, until it condenses into a high pressure, moderate temperature liquid. The condensed refrigerant then passes through a pressure-lowering device also called a metering device like an expansion valve, capillary tube, or possibly a work-extracting device such as a turbine. The low pressure, liquid refrigerant leaving the expansion device enters another heat exchanger, the evaporator, in which the fluid absorbs heat and boils. The refrigerant then returns to the compressor and the cycle is repeated.</p>', comment='<p><img border=\"0\" align=\"absmiddle\" width=\"376\" vspace=\"0\" hspace=\"0\" height=\"300\" alt=\"HPfeedback_1.png\" src=\"http://192.168.0.1/virtualclass/courses/KELASVI/document/images/diagrams/templates/HPfeedback_1.png\" />The working fluid, in its gaseous state, is pressurized and circulated through the system by a compressor. On the discharge side of the compressor, the now hot and highly pressurized vapor is cooled in a heat exchanger, called a condenser, until it condenses into a high pressure, moderate temperature liquid. The condensed refrigerant then passes through a pressure-lowering device also called a metering device like an expansion valve, capillary tube, or possibly a work-extracting device such as a turbine. The low pressure, liquid refrigerant leaving the expansion device enters another heat exchanger, the evaporator, in which the fluid absorbs heat and boils. The refrigerant then returns to the compressor and the cycle is repeated.</p>', 5='0.00', ponderation='0.00', 6='1', position='1', 7='', hotspot_coordinates='', 8='', hotspot_type='', 9='0@@0@@0@@0', destination='0@@0@@0@@0';
