INSERT INTO quiz_answer SET 0='1', id='1', 1='9', question_id='9', 2='increased', answer='increased', 3='0', correct='0', 4='In T2-weighted scans, like the T1-weighted scan, fat is differentiated from water - but in this case fat shows darker, and water lighter. They are therefore particularly well suited to imaging edema. On brain scans cerebral white matter (fat containing) therefore shows as darker than the grey matter. T2-weighted scans use a spin echo (SE) sequence, with long TE and long TR. They have long been the clinical workhorse as the spin echo sequence is less susceptible to inhomogeneities in the magnetic field.', comment='In T2-weighted scans, like the T1-weighted scan, fat is differentiated from water - but in this case fat shows darker, and water lighter. They are therefore particularly well suited to imaging edema. On brain scans cerebral white matter (fat containing) therefore shows as darker than the grey matter. T2-weighted scans use a spin echo (SE) sequence, with long TE and long TR. They have long been the clinical workhorse as the spin echo sequence is less susceptible to inhomogeneities in the magnetic field.', 5='0.00', ponderation='0.00', 6='1', position='1', 7='', hotspot_coordinates='', 8='', hotspot_type='', 9='', destination='';
