INSERT INTO quiz_answer SET 0='1', id='1', 1='10', question_id='10', 2='Platelets are proteins produced by the red blood cells whenever a blood vessel wall is injured', answer='Platelets are proteins produced by the red blood cells whenever a blood vessel wall is injured', 3='1', correct='1', 4='<p>Platelets play a fundamental role in hemostasis and are a natural source of growth factors. They circulate in the blood of mammals and are involved in hemostasis, leading to the formation of blood clots.</p><p>If the number of platelets is too low, excessive bleeding can occur. However, if the number of platelets is too high, blood clots can form (thrombosis), which may obstruct blood vessels and result in such events as a stroke, myocardial infarction, pulmonary embolism or the blockage of blood vessels to other parts of the body, such as the extremities of the arms or legs.</p>', comment='<p>Platelets play a fundamental role in hemostasis and are a natural source of growth factors. They circulate in the blood of mammals and are involved in hemostasis, leading to the formation of blood clots.</p><p>If the number of platelets is too low, excessive bleeding can occur. However, if the number of platelets is too high, blood clots can form (thrombosis), which may obstruct blood vessels and result in such events as a stroke, myocardial infarction, pulmonary embolism or the blockage of blood vessels to other parts of the body, such as the extremities of the arms or legs.</p>', 5='20.00', ponderation='20.00', 6='1', position='1', 7='', hotspot_coordinates='', 8='', hotspot_type='', 9='', destination='';
