INSERT INTO quiz_answer SET 0='1', id='1', 1='12', question_id='12', 2='Saturn', answer='Saturn', 3='1', correct='1', 4='<p>The Solar System consists of the Sun and the astronomical objects bound to it by gravity, all of which formed from the collapse of a giant molecular cloud approximately 4.6 billion years ago. Of the many objects that orbit the Sun, most of the mass is contained within eight relatively solitary planets[e] whose orbits are almost circular and lie within a nearly flat disc called the ecliptic plane. The four smaller inner planets, Mercury, Venus, Earth and Mars, also called the terrestrial planets, are primarily composed of rock and metal. The four outer planets, the gas giants, are substantially more massive than the terrestrials. The two largest, Jupiter and Saturn, are composed mainly of hydrogen and helium; the two outermost planets, Uranus and Neptune, are composed largely of ices, such as water, ammonia and methane, and are often referred to separately as ice giants.</p><p>Among the planets of the Solar System, indicate those that are not referred to as ice giants</p>', comment='<p>The Solar System consists of the Sun and the astronomical objects bound to it by gravity, all of which formed from the collapse of a giant molecular cloud approximately 4.6 billion years ago. Of the many objects that orbit the Sun, most of the mass is contained within eight relatively solitary planets[e] whose orbits are almost circular and lie within a nearly flat disc called the ecliptic plane. The four smaller inner planets, Mercury, Venus, Earth and Mars, also called the terrestrial planets, are primarily composed of rock and metal. The four outer planets, the gas giants, are substantially more massive than the terrestrials. The two largest, Jupiter and Saturn, are composed mainly of hydrogen and helium; the two outermost planets, Uranus and Neptune, are composed largely of ices, such as water, ammonia and methane, and are often referred to separately as ice giants.</p><p>Among the planets of the Solar System, indicate those that are not referred to as ice giants</p>', 5='10.00', ponderation='10.00', 6='1', position='1', 7='', hotspot_coordinates='', 8='', hotspot_type='', 9='', destination='';
