INSERT INTO tool_intro SET 0='wiki', id='wiki', 1='<table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tr><td valign=\"top\" align=\"left\">The word Wiki is short for WikiWikiWeb. Wikiwiki is a Hawaiian word, meaning \"fast\" or \"speed\". In a wiki, people write pages together. If one person writes something wrong, the next person can correct it. The next person can also add something new to the page. Because of this, the pages improve continuously.</td></tr></table>', intro_text='<table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tr><td valign=\"top\" align=\"left\">The word Wiki is short for WikiWikiWeb. Wikiwiki is a Hawaiian word, meaning \"fast\" or \"speed\". In a wiki, people write pages together. If one person writes something wrong, the next person can correct it. The next person can also add something new to the page. Because of this, the pages improve continuously.</td></tr></table>';